import React from "react";
import { useSelector} from 'react-redux'
function Home(){
  const Breeds = useSelector(state => state.Breeds)
  return(
    <div>
      { Breeds?.map(e => (
        <h1> {e.name}</h1>
      ))}
     <h1>hola</h1>
    </div>
  )
}
export default Home;
